  return (
    //we used xml width js
    //labels in lowercase convert them into REACT elements, then transform REACT component
    <div className="App">
      <TodoCounter />
      <TodoSearch />

      <TodoList>
        <TodoItem/>
        <TodoItem/>
        <TodoItem/>
      </TodoList>
      <CreateTodoButoon/>
    </div>
  );
}




export default App;
